import{g as a,f as e,E as r}from"./common-d6bd45c0.js";const n='{"title":"时间复杂度","frontmatter":{},"headers":[{"level":2,"title":"时间复杂度","slug":"时间复杂度"},{"level":2,"title":"空间复杂度","slug":"空间复杂度"}],"relativePath":"docs/algorithm/complexity.md","lastUpdated":1645544354367.9287}';var t={};const o=r('<p>评价算法的两个重要依据——<code>时间复杂度</code>和<code>空间复杂度</code></p><h2 id="时间复杂度"><a class="header-anchor" href="#时间复杂度" aria-hidden="true">#</a> 时间复杂度</h2><p>代码段执行的次数。</p><div class="language-"><pre><code>function traverse2(arr) {\n    var outLen = arr.length\n\n    for(var i=0;i&lt;outLen;i++) {\n        var inLen = arr[i].length\n\n        for(var j=0;j&lt;inLen;j++) { \n            console.log(arr[i][j])\n        }\n    }\n}\n</code></pre></div><p><a data-fancybox title="img" href="https://p1-jj.byteimg.com/tos-cn-i-t2oaga2asx/gold-user-assets/2020/4/6/1714f38044f931dd~tplv-t2oaga2asx-watermark.awebp"><img src="https://p1-jj.byteimg.com/tos-cn-i-t2oaga2asx/gold-user-assets/2020/4/6/1714f38044f931dd~tplv-t2oaga2asx-watermark.awebp" alt="img"></a></p><p>算法的时间复杂度，它反映的不是算法的逻辑代码到底被执行了多少次，而是随着输入规模的增大，算法对应的执行总次数的一个<code>变化趋势</code></p><p>遍历 N 维数组，需要 N 层循环，我们只需要关心其最内层那个循环体被执行多少次就行了。<br> 规模为 <code>n*n</code> 的二维数组遍历时，最内层的循环会执行 <code>n*n</code> 次，其对应的时间复杂度是 O(n^2)。</p><p>常见的时间复杂度表达，除了多项式以外，还有logn。我们一起来看另一个算法：</p><div class="language-"><pre><code>function fn(arr) {\n    var len = arr.length  \n    \n    for(var i=1;i&lt;len;i=i*2) {\n        console.log(arr[i])\n    }\n}\n</code></pre></div><p>假设 i 在以 i=i*2的规则递增了 x 次之后，i&lt;n 开始不成立（反过来说也就是 i&gt;=n 成立）。那么此时我们要计算的其实就是这样一个数学方程：</p><div class="language-"><pre><code>2^x &gt;= n  \n</code></pre></div><p><a data-fancybox title="img" href="https://p1-jj.byteimg.com/tos-cn-i-t2oaga2asx/gold-user-assets/2020/4/6/1714f5c2b41495c3~tplv-t2oaga2asx-watermark.awebp"><img src="https://p1-jj.byteimg.com/tos-cn-i-t2oaga2asx/gold-user-assets/2020/4/6/1714f5c2b41495c3~tplv-t2oaga2asx-watermark.awebp" alt="img"></a></p><p>也就是说，只有当 x 小于 log2n 的时候，循环才是成立的、循环体才能执行。注意涉及到对数的时间复杂度，底数和系数都是要被简化掉的。那么这里的 O(n) 就可以表示为：</p><div class="language-"><pre><code>O(n) = logn\n</code></pre></div><p>常见的时间复杂度按照从小到大的顺序排列，有以下几种： <a data-fancybox title="img" href="https://p1-jj.byteimg.com/tos-cn-i-t2oaga2asx/gold-user-assets/2020/4/6/1714f67c52dc8d15~tplv-t2oaga2asx-watermark.awebp"><img src="https://p1-jj.byteimg.com/tos-cn-i-t2oaga2asx/gold-user-assets/2020/4/6/1714f67c52dc8d15~tplv-t2oaga2asx-watermark.awebp" alt="img"></a></p><h2 id="空间复杂度"><a class="header-anchor" href="#空间复杂度" aria-hidden="true">#</a> 空间复杂度</h2><p>空间复杂度是对一个算法在运行过程中临时占用存储空间大小的量度。和时间复杂度相似，它是内存增长的趋势。<br> 常见的空间复杂度有 <code>O(1)</code>、<code>O(n)</code> 和 <code>O(n^2)</code>。</p><div class="language-"><pre><code>function traverse(arr) {\n    var len = arr.length\n    for(var i=0;i&lt;len;i++) {\n        console.log(arr[i])\n    }\n}\n</code></pre></div><p>在 <code>traverse</code> 中，占用空间的有以下变量：</p><div class="language-"><pre><code>arr    \nlen   \ni    \n</code></pre></div><p>后面尽管咱们做了很多次循环，但是这些都是时间上的开销。循环体在执行时，并没有开辟新的内存空间。因此，整个 traverse 函数对内存的占用量是恒定的，它对应的空间复杂度就是 <code>O(1)</code>。</p><p>下面我们来看另一个🌰，此时我想要初始化一个规模为 n 的数组，并且要求这个数组的每个元素的值与其索引始终是相等关系，我可以这样写：</p><div class="language-"><pre><code>function init(n) {\n    var arr = []\n    for(var i=0;i&lt;n;i++) {\n        arr[i] = i  // 这时 arr 是变化的\n    }\n    return arr\n}\n</code></pre></div><p>在这个 <code>init</code> 中，涉及到的占用内存的变量有以下几个：</p><div class="language-"><pre><code>n \narr\ni\n</code></pre></div><p>注意这里这个 arr，它并不是一个一成不变的数组。<strong>arr最终的大小是由输入的 n 的大小决定的，它会随着 n 的增大而增大、呈一个线性关系。因此这个算法的空间复杂度就是 O(n)</strong>。 由此我们不难想象，假如需要初始化的是一个规模为 n*n 的数组，那么它的空间复杂度就是 O(n^2) 啦。</p>',26);t.render=function(r,n,t,i,s,c){return e(),a("div",null,[o])};export default t;export{n as __pageData};
